"use strict";var menuButton=document.querySelector(".menuButtonWrap"),mobileMenu=document.querySelector("#mobile-menu"),hamburger=document.querySelector(".hamburger"),search=document.querySelector("#search"),searchWrapper=document.querySelector("#searchFormWrap"),closeNotification=document.querySelector("#btnCloseUpdateBrowser"),outdated=document.querySelector("#outdated");function toggleMobileMenu(){mobileMenu.classList.toggle("open"),hamburger.classList.toggle("is-active")}function toggleSearchForm(){searchWrapper.classList.toggle("searchOpen"),search.classList.toggle("iconOpacity"),console.log("clicked")}function closeOutdatedNotification(){outdated.classList.add("none")}menuButton.addEventListener("click",toggleMobileMenu),search.addEventListener("click",toggleSearchForm),closeNotification.addEventListener("click",closeOutdatedNotification);